import * as React from 'react';
import { StyleSheet, ScrollView, SafeAreaView, View, Text, TouchableOpacity, TextInput, Button, ImageBackground } from 'react-native';
import { IconButton, Colors } from 'react-native-paper';

export default function AirQuality({ navigation }) {

  const pressHandler = () => {
    navigation.goBack();
  }

  const Temperature = () => {
      navigation.replace('Temperature')
  }

  const Light = () => {
      navigation.replace('Light')
  }

  return (
    <>
      <View>
        Air Quality sensor
      </View>
      <View style={{flex: 1}}>
        <View style={{flexDirection:"row", height: 50, position: 'absolute', bottom: 30}}>
          <View style={{flex:1}}>
            <IconButton icon="thermometer-lines" size={50} onPress={Temperature}/>
          </View>
          <View style={{flex:1}}>
            <IconButton icon="brightness-6" size={50} onPress={Light}/>
          </View>
        </View>
      </View>
    </>
  );
}
